import React from 'react';

import NavigationItem from '../NavigationItems/NavigationItem/NavigationItem';
import './HorizontalNav.scss';

const horizontalNav = () => (
    <div className="horizontal_menu">
        <ul className="navbar-nav">
            <NavigationItem link="/" exact>About Us</NavigationItem>
            <NavigationItem link="course.html">Khóa Học</NavigationItem>
            <NavigationItem link="blog.html">Blog</NavigationItem>
            <NavigationItem link="student.html">Học Viên</NavigationItem>
            <NavigationItem link="document.html">Tài Liệu</NavigationItem>
            <NavigationItem link="contact.html">Liên Hệ</NavigationItem>           
        </ul>
    </div>
)

export default horizontalNav;
